import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "../styles/Dashboard.css";
import { FaUserCircle, FaCalendarAlt, FaHeartbeat, FaBell } from "react-icons/fa";

const Dashboard = () => {
  const navigate = useNavigate();

  useEffect(() => {
    const user = localStorage.getItem("user");
    if (!user) {
      navigate("/login", { replace: true }); // Redirect to login if not logged in
    }
  }, [navigate]);

  return (
    <div className="dashboard-container">
      <aside className="sidebar">
        <div className="profile">
          <FaUserCircle className="profile-icon" />
          <h2>CycleCare Dashboard</h2>
          <p>Track your menstrual health</p>
        </div>
        <nav>
          <a href="#" className="active"><FaCalendarAlt /> Tracker</a>
          <a href="#"><FaHeartbeat /> Mood Tracker</a>
          <a href="#"><FaBell /> Reminders</a>
        </nav>
      </aside>
      <main className="dashboard-content">
        <header>
          <h1>Welcome to Your Menstrual Tracker</h1>
          <p>Track, manage, and optimize your cycle health.</p>
        </header>
        <section className="stats">
          <div className="card">
            <h3>Next Predicted Period</h3>
            <p><strong>March 15, 2025</strong></p>
          </div>
          <div className="card">
            <h3>Current Phase</h3>
            <p><strong>Follicular</strong></p>
          </div>
        </section>
        <section className="features">
          <div className="feature-card">
            <img src="/cycle-tracker.png" alt="Track Your Cycle" />
            <div className="feature-info">
              <h3>Track Your Cycle</h3>
              <p>Monitor your cycle length, predict your next period, and get insights.</p>
              <button>Learn More</button>
            </div>
          </div>
          <div className="feature-card">
            <img src="/mood-tracker.png" alt="Track Your Mood" />
            <div className="feature-info">
              <h3>Track Your Mood</h3>
              <p>Log your mood daily to identify patterns and improve mental health.</p>
              <button>Log Mood</button>
            </div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default Dashboard;


